import {FaShoppingCart} from "react-icons/fa"

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink>
          
        </NavLink>
         <img src="logo.png" />
         <div>
          <p>Home</p>
          <FaShoppingCart/>
         </div>
      </div>
    </div>  
  )
};

export default Navbar;
